import ReactDOM from 'react-dom';import {
    BrowserRouter,
    Routes,
    Route,
    Switch,
  } from "react-router-dom";
import App from './App';
import About from './About'

ReactDOM.render(
    <>
       {/* <App/> */}
       {/* <Switch>
            <Route path="practiceproj\src\About.jsx" />
        </Switch> */}
        <BrowserRouter>
    <Routes>
      <Route path="/" element={<App />} />
      <Route path="About" element={<About />} />
      </Routes>
  </BrowserRouter>
        {/* <About/> */}
    </>,document.getElementById("root")
)
